import React, { useState } from 'react';
import './App.css';


function App() {
  const [todos, setTodos] = useState(["Do laundry", "cook food", "eat food"]);
  const [input, setInput] = useState('');
  console.log(">>>>",input);

  return (
    <div className="App">
      <h1>Todo APP</h1>
      <input value={input} onChange={event => setInput(event.target.value)}/>
      <button>Add Todo</button>

      <ul>
      {todos.map(todo => (
        <li>{todo}</li>
        ))}
      </ul>

    </div>
  );
}

export default App;
